import {Link} from 'react-router-dom'

// import ReactDOM from'reactdom'
class Medtimer extends React.Component {

constructor(props){
  super(props)
  this.state={entry: 0}
  this.onInputChange=this.onInputChange.bind(this);
  
} 

  onInputChange(event){
       this.setState({entry:event.target.value})
       console.log(this.state.entry)
      }

        
      
      
      render(){
    return(
  <div>
    <form>
      <input type="number" value={this.state.entry} placeholder='Enter minutes' onChange={this.onInputChange}></input>
    <button onSubmit={this.onInputChange} >submit</button>
    </form>
    
  </div>
)


}



}

  export default Medtimer;
